import { BrowserRouter as Router, Route } from "react-router-dom";

function App() {

  return (

    <Router>

      <Navbar />

      <Route path="/" component={Home} />

      <Route path="/about" component={About} />

    </Router>

  );

}

function Navbar() {

  return <>navbar</>

}

function Home() {

  return <>home</>;

}

function About() {

  return <>about</>;

}


export default App;
